import React, { useEffect } from "react";
import { Menu, MenuItem } from "@mui/material";

interface PropsPositionedMenu {
  id: string;
  open: boolean | null;
  event: React.MouseEvent<HTMLElement, MouseEvent>;
}

const MenuPositionedToolTip: React.FC<PropsPositionedMenu> = ({
  id,
  event,
}) => {
  const [anchorEl, setAnchorEl] = React.useState<null | HTMLElement>(null);
  const open: boolean | null = anchorEl;

  // handles the anchorElement event
  const handleClick = () => {
    setAnchorEl(event.currentTarget);
  };

  return (
    <Menu
      id='demo-positioned-menu'
      aria-labelledby={id}
      aria-expanded={open ? "true" : undefined}
      anchorEl={anchorEl}
      anchorOrigin={{
        vertical: "top",
        horizontal: "left",
      }}
      transformOrigin={{
        vertical: "top",
        horizontal: "left",
      }}>
      <MenuItem></MenuItem>
      <MenuItem></MenuItem>
      <MenuItem></MenuItem>
    </Menu>
  );
};

export default MenuPositionedToolTip;
